import React, { useState, useEffect } from 'react';
import { MapComponent } from './MapComponent';
import './SearchResults.css';

interface Place {
  name: string;
  type: string;
  address: string;
  lat: number;
  lng: number;
  distance?: number;
  rating?: number;
}

interface Category {
  name: string;
  score: number;
  places: Place[];
}

interface ScoreDetails {
  mobility: {
    score: number;
    transitStationScore: number;
    busStopScore: number;
    roadAccessScore: number;
    nearestTransitStation?: {
      name: string;
      distance: number;
      id: string;
    };
    nearestBusStop?: {
      id: string;
      distance: number;
      routes: string[];
    };
    nearestMainRoad?: {
      name: string;
      distance: number;
    };
  };
  livability: {
    score: number;
    categories: Category[];
  };
  emergencyServices: {
    score: number;
    nearbyServices: Place[];
  };
  overallScore: number;
}

interface SearchResultsProps {
  address: string;
  results: {
    geocodedAddress: string;
    lat: number;
    lng: number;
    scores: ScoreDetails;
  } | null;
  loading: boolean;
  error: string | null;
}

const SearchResults: React.FC<SearchResultsProps> = ({ address, results, loading, error }) => {
  const [allNearbyPlaces, setAllNearbyPlaces] = useState<Place[]>([]);

  // Collect all nearby places for the map
  useEffect(() => {
    if (results) {
      const places: Place[] = [];

      // Add emergency services
      if (results.scores.emergencyServices.nearbyServices) {
        places.push(...results.scores.emergencyServices.nearbyServices);
      }

      // Add places from livability categories
      if (results.scores.livability.categories) {
        results.scores.livability.categories.forEach(category => {
          if (category.places) {
            places.push(...category.places);
          }
        });
      }

      setAllNearbyPlaces(places);
    }
  }, [results]);

  if (loading) {
    return <div className="search-results loading">Analyzing address...</div>;
  }

  if (error) {
    return <div className="search-results error">{error}</div>;
  }

  if (!results) {
    return null;
  }

  // Helper function to render the score bar
  const renderScoreBar = (score: number) => {
    const scoreClass = score >= 80 ? 'excellent' : score >= 60 ? 'good' : score >= 40 ? 'average' : 'poor';

    return (
      <div className="score-bar-container">
        <div className={`score-bar ${scoreClass}`} style={{ width: `${score}%` }}></div>
        <span className="score-value">{score}/100</span>
      </div>
    );
  };

  // Helper function to render places list
  const renderPlacesList = (places: Place[] | undefined) => {
    if (!places || places.length === 0) {
      return <p>No nearby places found</p>;
    }

    return (
      <ul className="places-list">
        {places.slice(0, 5).map((place, index) => (
          <li key={index} className="place-item">
            <strong>{place.name}</strong>
            <p>{place.address}</p>
            {place.distance !== undefined && (
              <p>Distance: {(place.distance / 1000).toFixed(2)} km</p>
            )}
            {place.rating !== undefined && (
              <p>Rating: {place.rating}/5</p>
            )}
          </li>
        ))}
      </ul>
    );
  };

  return (
    <div className="search-results">
      <div className="address-header">
        <h2>{results.geocodedAddress}</h2>
        <p className="coordinates">
          Latitude: {results.lat.toFixed(6)}, Longitude: {results.lng.toFixed(6)}
        </p>
      </div>

      <div className="overall-score">
        <h3>Overall Score: {results.scores.overallScore}/100</h3>
        {renderScoreBar(results.scores.overallScore)}
      </div>

      <div className="results-container">
        <div className="scores-panel">
          <div className="score-section">
            <h3>Mobility Score: {results.scores.mobility.score}/100</h3>
            {renderScoreBar(results.scores.mobility.score)}

            <div className="sub-scores">
              <div className="sub-score">
                <h4>Transit Station: {results.scores.mobility.transitStationScore}/100</h4>
                {renderScoreBar(results.scores.mobility.transitStationScore)}
                {results.scores.mobility.nearestTransitStation && (
                  <p>Nearest: {results.scores.mobility.nearestTransitStation.name}, {(results.scores.mobility.nearestTransitStation.distance / 1000).toFixed(2)} km</p>
                )}
              </div>

              <div className="sub-score">
                <h4>Bus Stop: {results.scores.mobility.busStopScore}/100</h4>
                {renderScoreBar(results.scores.mobility.busStopScore)}
                {results.scores.mobility.nearestBusStop && (
                  <p>Nearest: Stop #{results.scores.mobility.nearestBusStop.id}, {(results.scores.mobility.nearestBusStop.distance / 1000).toFixed(2)} km</p>
                )}
              </div>

              <div className="sub-score">
                <h4>Road Access: {results.scores.mobility.roadAccessScore}/100</h4>
                {renderScoreBar(results.scores.mobility.roadAccessScore)}
                {results.scores.mobility.nearestMainRoad && (
                  <p>Nearest: {results.scores.mobility.nearestMainRoad.name}, {(results.scores.mobility.nearestMainRoad.distance / 1000).toFixed(2)} km</p>
                )}
              </div>
            </div>
          </div>

          <div className="score-section">
            <h3>Livability Score: {results.scores.livability.score}/100</h3>
            {renderScoreBar(results.scores.livability.score)}

            <div className="category-accordion">
              {results.scores.livability.categories.map((category, index) => (
                <details key={index} className="category-details">
                  <summary>
                    {category.name}: {category.score}/100
                    {renderScoreBar(category.score)}
                  </summary>
                  {renderPlacesList(category.places)}
                </details>
              ))}
            </div>
          </div>

          <div className="score-section">
            <h3>Emergency Services: {results.scores.emergencyServices.score}/100</h3>
            {renderScoreBar(results.scores.emergencyServices.score)}

            <details className="category-details">
              <summary>Nearby Emergency Services</summary>
              {renderPlacesList(results.scores.emergencyServices.nearbyServices)}
            </details>
          </div>
        </div>

        <div className="map-container">
          <MapComponent 
            latitude={results.lat} 
            longitude={results.lng} 
            address={results.geocodedAddress}
            nearbyPlaces={allNearbyPlaces} 
          />
        </div>
      </div>
    </div>
  );
};

export default SearchResults;
